import React, { useState, useEffect } from "react";
import {useHistory, useParams} from 'react-router-dom'
import Nav from "../nav/nav"
import '../../style.css';

import {Table} from 'reactstrap';


const ViewResume = () => {

    const [resumeData, setResumeData] = useState({});

    const history = useHistory();

    // const resumeInfo = {
    //     patientID:id, 
    //     careproviderID: careprovider
    // }

    // const resumeInfoEdit = {
    //     patientID:id, 
    //     patientEditID: patientEdit
    // }


  useEffect(() => {

    async function fetchData() {
      const res = await fetch(`http://localhost:4000/resume`);
      res.json().then((res) => setResumeData(res));

    }
    fetchData();
  });

//   // Go Back function
//   const goBack = () => {
//     history.goBack()
// }

  return (
    <main>
        <Nav />
        <h3>Resume</h3>
        <Table striped>
            <thead>
                <tr>
                    <th>FDSFSDFSDFSDF</th>
                    <th>{resumeData.job}</th>
                    <th>{resumeData.jobTitle}</th>
                    <th>{resumeData.date}</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>{resumeData.note1}</td>
                    <td>{resumeData.note2}</td>
                    <td>{resumeData.note3}</td>
                    <td>{resumeData.note4}</td>
                </tr>
            </tbody>
        </Table>
    </main>
  );
};

export default ViewResume;
